  false,\n\t\"url\": null,\n\t\"notes\": \"In order to conform to the Wilderness Act
  of 1964, a study was conducted by the Bureau of Sport Fisheries and Wildlife personnel
  to ascertain which of the Kenai National Moose Range's acres qualify for possible
